function populateColleges(){
    for (let i=0; i<colleges.length; i++){
        const collegee = colleges[i]
        for (let j = 0; j < 6; j++) {
            const categoryy = categoriesss[j];
            for (let k = 0; k < 5; k++) {
                const branchh = branchesss[k];
                let branchcat = String(branchh)+String(categoryy)
                let branchcat2 = String(branchh)+String(categoryy)+"2"
                let firstRank = 1
                let secondRank = 1
                for(const property in collegee){
                    if(property == branchcat){
                        firstRank = collegee[property]
                    }
                    if(property == branchcat2){
                        secondRank = collegee[property]
                    }
                    
                }
                let newCollege = new College(collegee,firstRank,secondRank,categoryy,branchh)
                newColleges.push(newCollege)
            }
        }
}
